void distribution_probability_2(int_fixed img1[ox*oy],int_fixed img2[ox*oy], long_fixed dst[max_pixels*max_pixels]){
    //int_fixed p, q;

    //initialize values by 0
    for(int i = 0; i < max_pixels * max_pixels; i++)  dst[i] = 0;

    //histo calculation
    for (int i = 0; i < ox*oy; i++)
    {
        //p = img1[i];
        //q = img2[i];
        dst[(img1[i]>>1).to_int() + max_pixels* (img2[i]>>1).to_int()] ++;
    }
}


double_fixed mylog2(double_fixed m){
    if (m==0) return 0;
    double_fixed s=0;
    int_fixed n = m;
    for (int i=1; i<8;i++){
        //cout << n[i];
        if (n[i]) s=i;
        if (m >= 1.999) m = m >> 1;
        //cout << m <<" ";
    }
    //cout <<" s=" <<s<< endl;

    if (m >= 0.9999){
        s=s+ mylog2_top(m);
    }else s=s+ mylog2_down(m);
    return s;
}

//logarithm for values bigger than 1,2
double_fixed mylog2_top(double_fixed u)
{
    double_fixed s = 0.0, r = 0.5;
    double_fixed t = 0.5;
    //double_fixed u = w;
    for(int i = 0; i < 16; i++)
    {
        u = u * u;
        if(u > 2)
        {
            u = u >> 1;
            s += t;
        }
        t *= r;
    }
    return s;
}
